// src/pages/TeamMonitor.js

import React, { useState, useEffect } from "react";
import {
    LineChart,
    Line,
    BarChart,
    Bar,
    PieChart,
    Pie,
    Tooltip,
    XAxis,
    YAxis,
    CartesianGrid,
    Legend,
    ResponsiveContainer,
    Cell,
} from "recharts";
import { Card, CardContent } from "@/components/ui/card";
import { Button } from "@/components/ui/button";

// Dummy inbox & stats – backend’den alabilirsin
const dummyInbox = [
    { id: 1, title: "Talep A", status: "Tamamlandı", created: "2025-08-01", completed: "2025-08-02" },
    { id: 2, title: "Talep B", status: "Devam Ediyor", created: "2025-08-05", completed: null },
    { id: 3, title: "Talep C", status: "Tamamlandı", created: "2025-08-07", completed: "2025-08-08" },
];

const dailyStats = [
    { day: "01 Ağu", tamamlanan: 3 },
    { day: "02 Ağu", tamamlanan: 5 },
    { day: "03 Ağu", tamamlanan: 2 },
    { day: "04 Ağu", tamamlanan: 6 },
    { day: "05 Ağu", tamamlanan: 4 },
];

const durationStats = [
    { name: "0-1 gün", value: 4 },
    { name: "2-3 gün", value: 2 },
    { name: "3+ gün", value: 1 },
];

const COLORS = ["#4ade80", "#60a5fa", "#facc15", "#f87171"];

export default function TeamMonitor() {
    const [selectedUser, setSelectedUser] = useState(null);
    const [inbox, setInbox] = useState([]);

    useEffect(() => {
        if (selectedUser) {
            // Burada API çağrısı yapıp kullanıcının inboxını çekebilirsin
            setInbox(dummyInbox);
        }
    }, [selectedUser]);

    return (
        <div className="p-6 space-y-6 bg-gray-100 min-h-screen text-gray-900">
            <h1 className="text-2xl font-bold">Team Monitor</h1>

            {/* Kullanıcı seçme */}
            <div className="flex gap-3">
                <Button onClick={() => setSelectedUser("Kerem")}>Kerem</Button>
                <Button onClick={() => setSelectedUser("Görkem")}>Görkem</Button>
                <Button onClick={() => setSelectedUser("Ayşe")}>Ayşe</Button>
            </div>

            {selectedUser && (
                <>
                    {/* Inbox */}
                    <Card className="shadow-lg">
                        <CardContent>
                            <h2 className="text-xl font-semibold mb-4">
                                {selectedUser} - Inbox
                            </h2>
                            <div className="space-y-2">
                                {inbox.map((item) => (
                                    <div
                                        key={item.id}
                                        className="flex justify-between bg-white p-3 rounded-lg shadow-sm"
                                    >
                                        <span>{item.title}</span>
                                        <span
                                            className={`font-medium ${item.status === "Tamamlandı"
                                                    ? "text-green-600"
                                                    : "text-yellow-600"
                                                }`}
                                        >
                                            {item.status}
                                        </span>
                                    </div>
                                ))}
                            </div>
                        </CardContent>
                    </Card>

                    {/* Analizler */}
                    <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
                        {/* Günlük tamamlanan işler (Bar Chart) */}
                        <Card className="shadow-lg">
                            <CardContent>
                                <h3 className="text-lg font-semibold mb-4">
                                    Günlük Tamamlanan İşler
                                </h3>
                                <ResponsiveContainer width="100%" height={250}>
                                    <BarChart data={dailyStats}>
                                        <CartesianGrid strokeDasharray="3 3" />
                                        <XAxis dataKey="day" />
                                        <YAxis />
                                        <Tooltip />
                                        <Legend />
                                        <Bar dataKey="tamamlanan" fill="#60a5fa" />
                                    </BarChart>
                                </ResponsiveContainer>
                            </CardContent>
                        </Card>

                        {/* Ortalama süre dağılımı (Pie Chart) */}
                        <Card className="shadow-lg">
                            <CardContent>
                                <h3 className="text-lg font-semibold mb-4">
                                    Ortalama Tamamlanma Süreleri
                                </h3>
                                <ResponsiveContainer width="100%" height={250}>
                                    <PieChart>
                                        <Pie
                                            data={durationStats}
                                            dataKey="value"
                                            nameKey="name"
                                            outerRadius={100}
                                            label
                                        >
                                            {durationStats.map((entry, index) => (
                                                <Cell
                                                    key={`cell-${index}`}
                                                    fill={COLORS[index % COLORS.length]}
                                                />
                                            ))}
                                        </Pie>
                                        <Tooltip />
                                    </PieChart>
                                </ResponsiveContainer>
                            </CardContent>
                        </Card>

                        {/* Trend (Line Chart) */}
                        <Card className="shadow-lg md:col-span-2">
                            <CardContent>
                                <h3 className="text-lg font-semibold mb-4">
                                    Talep Trendleri
                                </h3>
                                <ResponsiveContainer width="100%" height={300}>
                                    <LineChart data={dailyStats}>
                                        <CartesianGrid strokeDasharray="3 3" />
                                        <XAxis dataKey="day" />
                                        <YAxis />
                                        <Tooltip />
                                        <Legend />
                                        <Line
                                            type="monotone"
                                            dataKey="tamamlanan"
                                            stroke="#4ade80"
                                            strokeWidth={2}
                                        />
                                    </LineChart>
                                </ResponsiveContainer>
                            </CardContent>
                        </Card>
                    </div>
                </>
            )}
        </div>
    );
}
